import React,{useState} from "react";
import { Link } from "react-router-dom";
import { useSelector} from "react-redux";
import * as selectors from '../../redux/users/user-selector'
import s from './List.module.css'
import { Button } from "@mui/material";
export default function List() {
    const repositories = useSelector(selectors.getState);
    // const [repo,setRepo]=useState({owner: {}})
    return (
        <ul className={s.list}>{repositories.map((repo) => (<li key={repo.id} className={s.item} >
            <img className={s.img} src={repo.owner.avatar_url} alt='dfsdf' />
            <p className={s.name}>{repo.name}</p>
            <p>{repo.stargazers_count}</p>
            <div className={s.cont}>
            <Link to={`/search/${repo.id}`}>View More</Link>
            <Button  variant="outlined" type='button'>Add to favorite</Button>
            </div>
        </li>))}
        </ul>
    );
 }
